import React, { Component } from 'react';
import { View, ScrollView, Text } from 'react-native';
import { styles } from './styles';

class App extends Component{
  render(){
    return(
      <View style={styles.container}>
      <Text style={styles.titulo}>Vagas</Text>
        <ScrollView>
          <View style={styles.caixa}>
            <Text style={styles.tituloVaga}>Dev .NET Júnior</Text>
            <Text style={styles.texto}>Salário: R$ 3.800</Text>
            <Text style={styles.texto}>Descrição: Desenvolver soluções Web em C#/.NET, fazer manutenção de código e auxiliar na modernização de código legado</Text>
            <Text style={styles.texto}>Contato: techsoluções@gmail.com | (11) 1521 - 2319</Text>
          </View>
          <View style={styles.caixa}>
            <Text style={styles.tituloVaga}>Scrum Master</Text>
            <Text style={styles.texto}>Salário: R$ 5.200</Text>
            <Text style={styles.texto}>Descrição: Líderar equipes, engajar pessoas, facilitar reuniões com o cliente</Text>
            <Text style={styles.texto}>Contato: rhexpert@outlook.com | (13) 7591 - 3227</Text>
          </View>
          <View style={styles.caixa}>
            <Text style={styles.tituloVaga}>Estagiário</Text>
            <Text style={styles.texto}>Salário: R$ 2.000</Text>
            <Text style={styles.texto}>Descrição: </Text>
            <Text style={styles.texto}>Contato: fitbusca@gmail.com | (11) 7231 - 3652</Text>
          </View>
        </ScrollView>
      </View>
    )
  }
}

export default App;
